frame_eqs_eel:
mv_g=1-bass_att*.4;
beat=if(above(bass*bass_att,4.5),1-beat,beat);
q1=beat*2-1;

amp =amp*.8+.2*(bass_att+mid_att+treb_att)*.3;
q2 = min(amp,1);
trebcap=trebcap*.7+.16*treb;
q3=trebcap*2;
monitor = q3;

pixel_eqs_eel:
wang = (3+q3)*x+time*1.7+bass*.1;
in = 0;
in = in + below(abs(x-.25),.05)*below(abs(y-.5),.25);
in = below(abs(y-(.5+.5*sin(wang)*q2)),.1);
in=bnot(bnot(in));
dx = .02*in;
dy = .08*cos(wang)*q2*in;

dx = dx+bnot(in)*.005*q1;
dy = dy+bnot(in)*cos(wang)*-.01*q1;
